import React, { Component } from "react";
import "./App.css";
import Postuler from "./components/dashboardAide/postuler-aide";
import Accueil from "./components/accueil";
import GestionReservation from "./components/dashboardAide/gestion-reservation";
import GestionUsers from "./components/dashbordAdmin/gestion-users";
import Connexion from "./components/connexion-navbar";

import { BrowserRouter, Switch, Route } from "react-router-dom";

export class Connex extends Component {
  render() {
    return (
      <div className="App">
        <BrowserRouter>
          <div>
            <Switch>
              <Route exact path="/">
                <Accueil />
              </Route>
              <Route exact path="/aide">
                <Postuler />
              </Route>
              <Route path="/gestion-reservation">
                <GestionReservation />
              </Route>
              <Route path="/gestion-users">
                <GestionUsers />
              </Route>

              <Route path="/login">
                <Connexion />
              </Route>
            </Switch>
          </div>
        </BrowserRouter>
      </div>
    );
  }
}

export default App;
